/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER update_stock AFTER INSERT ON order_details
  FOR EACH ROW BEGIN
    UPDATE product 
    SET quantity = quantity - NEW.quantity
    WHERE product_id = NEW.product_id;
  END */;;
