/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 trigger update_amount
  after INSERT
  on order_details
  for each row
BEGIN
    UPDATE orders o
    join order_details od on (o.order_id = od.order_id)
    join product p on (od.product_id = p.product_id)
    SET o.order_amount = coalesce(o.order_amount,0) + (NEW.quantity * p.unit_price)
    WHERE o.order_id = NEW.order_id and od.order_details_id = NEW.order_details_id;
END */;;
DELIMITER ;
